char p[9][9],m[9][9];

void vertical(int ti,int tj){
	for(int i=ti+1;i<9;i++)
		if(p[ti][tj] == p[i][tj])
			m[ti][tj] = m[i][tj] = '*';
}

void horizontal(int ti,int tj){
	for(int j=tj+1;j<9;j++)
		if(p[ti][tj] == p[ti][j])
			m[ti][tj] = m[ti][j] = '*';
}

void square(int ti,int tj){
	for(int k=(ti%3)*3+tj%3+1;k<9;k++){
		int i=ti/3*3+k/3, j=tj/3*3+k%3;
		if(p[ti][tj] == p[i][j])
			m[ti][tj] = m[i][j] = '*';
	}
}

