void search(int x,int y) {
  bool check=true;
  int temp = field[x][y];

  for(int i=0;i<9;i++) { //tate
    if(field[i][y] == temp && i != x){
      check = false;
    }
  }

  for(int i=0;i<9;i++) { //yoko
    if(field[x][i] == temp && i != y){
      check = false;
    }
  }

  for(int i=(x/3)*3;i<(x/3)*3+3;i++) { // 3*3 square
    for(int j=(y/3)*3;j<(y/3)*3+3;j++) {
      if((field[i][j] == temp) && (i != x) && (j != y)) {
	check = false;
      }
    }
  }

  if(check) {
    afield[x][y] = ' ';
  }
  else {
    afield[x][y] = '*';
  }
}

void solve() {
  for(int i=0;i<9;i++) {
    for(int j=0;j<9;j++) {
      search(i,j);
    }
  }
}

