			check[n]++;
		}
		for(int y=0;y<9;y++){
			int n = board[y][x] - '0';
			if(check[n] > 1)flag[y][x] = false;
		}
	}
	for(int y=0;y<9;y+=3){ 
		for(int x=0;x<9;x+=3){
			vector<int> check(10, 0);
			for(int dy=0;dy<3;dy++)for(int dx=0;dx<3;dx++){
