int he(int i, int j) {

	int f=0;

	for(int k=0; k<9; k++) {
		if(p[i][j]==p[k][j]&&!(i==k)) {
			f++;
		}
	}
	return (f ? 1 : 0);

}


int le(int i, int j) {

	int f=0;

	for(int l=0; l<9; l++) {
		if(p[i][j]==p[i][l]&&!(j==l)) {
			f++;
		}
	}
	return (f ? 1 : 0);

}


int sq(int i, int j) {

	int f=0, x=(i/3)*3, y=(j/3)*3;

	for(int k=x; k<x+3; k++) {
		for(int l=y; l<y+3; l++) {
			if(p[i][j]==p[k][l]&&!(i==k&&j==l)) {
				f++;
			}
		}
	}
	return (f ? 1 : 0);

}

