  int sx,tx,sy,ty;

  field(x,sx,tx);
  field(y,sy,ty);

  for(int i = sx ; i < tx ; i++){
    for(int j = sy ; j < ty ; j++){

      if(x == i && y == j) continue;
      if(puzzle[x][y] == puzzle[i][j]) return false;
