const int SIZE = 9;
int T[SIZE][SIZE];
bool F[SIZE][SIZE];

void input() {
    for ( int i = 0; i < SIZE; ++ i ) {
        for ( int j = 0; j < SIZE; ++ j ) {
            cin >> T[i][j];
        }
    }
}

bool check( int r, int c ) {
    int sr = r - r % 3;
    int sc = c - c % 3;
    for ( int i = 0; i < SIZE; ++ i ) {
        if ( i != c && T[r][c] == T[r][i] ) return true;
        if ( i != r && T[r][c] == T[i][c] ) return true;
    }
    for ( int i = 0; i < 3; ++ i ) {
        for ( int j = 0; j < 3; ++ j ) {
            if ( sr + i == r && sc + j == c ) continue;
            if ( T[r][c] == T[sr+i][sc+j] ) return true;
        }
    }
    return false;
}

void solve() {
    fill( (bool*)F, (bool*)F+SIZE*SIZE, false );
    for ( int i = 0; i < SIZE; ++ i ) {
        for ( int j = 0; j < SIZE; ++ j ) {
            F[i][j] = check( i, j );
        }
    }
    for ( int i = 0; i < SIZE; ++ i ) {
        for ( int j = 0; j < SIZE; ++ j ) {
            cout << ( F[i][j] ? '*' : ' ' ) << T[i][j];
        }
        cout << endl;
    }
}

int main() {
    int n;
    while ( cin >> n ) {
        for ( int i = 0; i < n; ++ i ) {
            input();
            solve();
            if ( i + 1 < n ) cout << endl;
        }
    }
    return 0;
}

