#include <iostream>
#include <algorithm>
using namespace std;

const int H = 9;
const int W = 9;

int G[H][W];

bool chack(int pi, int pj) {
  for(int i = 0; i < H; ++i) {
    for(int j = 0; j < W; ++j) {
      if(i == pi && j == pj) continue;
      if(i == pi || j == pj || i/3 == pi/3 && j/3 == pj/3) {
        if(G[i][j] == G[pi][pj]) return true;
      }
    }
  }
  return false;
}

int main() {
  int Tc;
  cin >> Tc;
  for(int tc = 0; tc < Tc; ++tc) {
    for(int i = 0; i < H; ++i) {
      for(int j = 0; j < W; ++j) {
        if(cin >> G[i][j]) ; else return 0;
      }
    }
    if(tc) cout << endl;
    for(int i = 0; i < H; ++i) {
      for(int j = 0; j < W; ++j) {
        cout << ( chack(i, j) ? '*' : ' ' );
        cout << G[i][j];
      }
      cout << endl;
    }
  }
  return 0;
}

#include<bits/stdc++.h>
using namespace std;

int n;
int board[9][9];
int dxy[3][3] = { { 0, 1, 2},
		  {-1, 0, 1},
		  {-2,-1, 0} };

bool cheak(int y,int x){
  for(int i=0;i<9;i++){
    if(i != y && board[y][x] == board[i][x]) return true;
    if(i != x && board[y][x] == board[y][i]) return true;
  }
  int py = y % 3;
  int px = x % 3;
  for(int i=0;i<3;i++){
    for(int j=0;j<3;j++){
      int nx = x+dxy[px][i];
      int ny = y+dxy[py][j];
      if(nx == x && ny == y) continue;
      if(board[y][x] == board[ny][nx]) return true;
    }
  }
  return false;
}

int main(){
  cin >> n;
  while(n--){
    for(int i=0;i<9;i++){
      for(int j=0;j<9;j++){
	cin >> board[i][j];
      }
    }
    for(int i=0;i<9;i++){
      for(int j=0;j<9;j++){
	if(cheak(i,j)) cout << "*" << board[i][j];
	else cout << " " << board[i][j];
      }
      cout << endl;
    }
    if(n != 0) cout << endl;
  }
}

