#include <bits/stdc++.h>
using namespace std;

int n,tb[11][11];
bool ch[11][11];

void check_ver(int x, int y){
	for(int i = 1; i <= 9; i++){
		if(i != x && tb[i][y] == tb[x][y]){
			ch[x][y] = ch[i][y] = true;
		}
	}
}
void check_hol(int x,int y){
	for(int i = 1; i <= 9; i++){
		if(i != y && tb[x][i] == tb[x][y]){
			ch[x][y] = ch[x][i] = true;
		}
	}
}
void check_blk(int x,int y){
	for(int i = ((x-1)/3)*3+1; i <= ((x-1)/3)*3+3; i++){
		for(int j = ((y-1)/3)*3+1; j <= ((y-1)/3)*3+3; j++){
			if(!(i == x && j == y) && tb[x][y] == tb[i][j]){
				ch[x][y] = ch[i][j] = true;
			}
		}
	}
}

int main(){
	scanf("%d",&n);
	for(int tm = 0; tm < n; tm++){
		for(int i = 1; i <= 9; i++){
			for(int j = 1;j <= 9; j++){
				scanf("%d",&tb[i][j]);
				ch[i][j] = false;
			}
		}
		for(int i = 1; i <= 9; i++){
			for(int j = 1;j <= 9; j++){
				check_ver(i,j);
				check_hol(i,j);
				check_blk(i,j);
			}
		}
		if(tm != 0){
			puts("");
		}
		for(int i = 1; i <= 9; i++){
			for(int j = 1;j <= 9; j++){
				printf("%c%d",ch[i][j] ? '*' : ' ',tb[i][j]);
			}
			puts("");
		}

	}

	return 0;
}

