        else
        {
            cout << endl;
        }

        for (int j = 0; j < 9; j++)
        {
            for (int k = 0; k < 9; k++)
            {
                cin>>board[j][k];
            }
        }

        for (int j = 0; j < 9; j++)
        {
            for (int k = 0; k < 9; k++)
            {
                char c = ' ';

                if (!Solution(j, k))
                {
                    c = '*';
                }

                cout << c << board[j][k];
            }

            cout << endl;
        }
    }

    return 0;
}

