bool ok(int a,int b){
	int i,j;
	for(i=0;i<9;i++){
		if(i!=a&&sudoku[a][b]==sudoku[i][b])return false;
	}
	for(i=0;i<9;i++){
		if(i!=b&&sudoku[a][b]==sudoku[a][i])return false;
	}
	for(i=a/3*3;i<a/3*3+3;i++){
