vector <string> disp_res (vector <vector <int> > t, vector <vector<bool> > c )
{
	int size = t.size();
	int len  = t[0].size();
	int i,j;
	vector <string> res (size);

	for (i = 0; i < size; ++i ){
		for (j = 0; j < len; ++j ){
			if (c[i][j]){
//				cout << ' ' << t[i][j];
				res[i] += ' ';
			}else{
				res[i] += '*';
//				cout << '*' << t[i][j];
			} // end if
			res[i] += (t[i][j] + '0');
		} // end for
//		cout << endl;
	} // end for

	return res;
}

void iscorrect (vector <vector <int> > b, vector <vector <bool> >& c )
{
	int i,j,k,m;

	// search hight
	for (j = 0; j < N; ++j){
		vector <vector <int> > used(N + 1);
		for (i = 0; i < N; ++i){
//			cout << b[i][j] << ' ';
			used[b[i][j]].push_back(i);
		} // end for
//		cout << endl;
		for (m = 1; m <= N; ++m){
			if (!used[m].empty() && used[m].size() == 1){
				continue;
			} // end if
			if (!used[m].empty() && used[m].size() > 1){
				for (k = 0; k < used[m].size(); ++k){
					c[used[m][k]][j] = false;
				} // end if
			} // end if
		} // end for
		used.clear();	
	} // end for

	// search width
	for (i = 0; i < N; ++i){
		vector <vector <int> > used(N + 1);
		for (j = 0; j < N; ++j){
//			cout << b[i][j] << ' ';
			used[b[i][j]].push_back(j);
		} // end for
//		cout << endl;
		for (m = 1; m <= N; ++m){
			if (!used[m].empty() && used[m].size() == 1){
				continue;
			} // end if
			if (!used[m].empty() && used[m].size() > 1){
				for (k = 0; k < used[m].size(); ++k){
					c[i][used[m][k]] = false;
				} // end if
			} // end if
		} // end for
		used.clear();	
	} // end for

	// search block
	for (i = 0; i < N; i += 3){
		for (j = 0; j < N; j += 3){
			vector <vector <int> > used (N + 1);
			for (k = 0; k < N; ++ k){
				int row = i + k / 3;
				int col = j + (k % 3);
//				cout << b[row][col] << ' ';
				used[b[row][col]].push_back(k);
			} // end for
//			cout << endl;
			for (m = 1; m <= N; ++m){
				if (!used[m].empty() && used[m].size() == 1){
					continue;
				} // end if
				if (!used[m].empty() && used[m].size() > 1){
					for (k = 0; k < used[m].size(); ++k){
						c[ i + used[m][k]/3 ][ j + (used[m][k] % 3) ] = false;
					} // end if
				} // end if
			} // end for
			used.clear();	
		} // end for
	} // end for


}
