void input(int mat[9][9])
{
	for(int i=0;i<9;i++)
	{
		for(int j=0;j<9;j++)
		{
			std::cin>>mat[i][j];
		}
	}
}

void checkrow(const int mat[9][9],std::set<std::pair<int,int> >& wrong,int r)
{
	int already[9];
	memset(already,-1,sizeof(already));
	for(int j=0;j<9;j++)
	{
		if(already[mat[r][j]-1]!=-1)
		{
			wrong.insert(std::pair<int,int>(r,j));
			wrong.insert(std::pair<int,int>(r,already[mat[r][j]-1]));
		}
		already[mat[r][j]-1]=j;
	}
}

void checkcolumn(const int mat[9][9],std::set<std::pair<int,int> >& wrong,int c)
{
	int already[9];
	memset(already,-1,sizeof(already));
	for(int i=0;i<9;i++)
	{
		if(already[mat[i][c]-1]!=-1)
		{
			wrong.insert(std::pair<int,int>(i,c));
			wrong.insert(std::pair<int,int>(already[mat[i][c]-1],c));
		}
		already[mat[i][c]-1]=i;
	}
}

void checksquare(const int mat[9][9],std::set<std::pair<int,int> >& wrong,int n)
{
	int already[9];
	memset(already,-1,sizeof(already));
	for(int i=n/3*3;i<n/3*3+3;i++)
	{
		for(int j=n%3*3;j<n%3*3+3;j++)
		{
			if(already[mat[i][j]-1]!=-1)
			{
				wrong.insert(std::pair<int,int>(i,j));
				wrong.insert(std::pair<int,int>(already[mat[i][j]-1],j));
			}
			already[mat[i][j]-1]=i;
		}
	}
}

void output(const int mat[9][9],const std::set<std::pair<int,int> >& wrong)
{
	for(int i=0;i<9;i++)
	{
		for(int j=0;j<9;j++)
		{
			if(wrong.find(std::pair<int,int>(i,j))==wrong.end())
			{
				std::cout<<' ';
			}
			else
			{
				std::cout<<'*';
			}
			std::cout<<mat[i][j];
		}
		std::cout<<std::endl;
	}
}

