			for (int x = 0; x < 9; ++x)
				check[y][x] = ' ';
		}

		for (int x = 0; x < 9; ++x)
		{
			for (int i = 1; i <= 9; ++i)
				state[i - 1] = none;

			for (int y = 0; y < 9; ++y)
			{
				int t = puzzle[y][x];
				if (state[t - 1] == none)
					state[t - 1] = done;
				else
					state[t - 1] = dupli;
			}

			for (int i = 1; i <= 9; ++i)
			{
				if (state[i - 1] == dupli)
				{
					for (int y = 0; y < 9; ++y)
					{
						if (puzzle[y][x] == i)
							check[y][x] = '*';
					}
				}
			}
		}

		for (int y = 0; y < 9; ++y)
		{
			for (int i = 1; i <= 9; ++i)
				state[i - 1] = none;

			for (int x = 0; x < 9; ++x)
			{
				int t = puzzle[y][x];
				if (state[t - 1] == none)
					state[t - 1] = done;
				else
					state[t - 1] = dupli;
			}

			for (int i = 1; i <= 9; ++i)
			{
				if (state[i - 1] == dupli)
				{
					for (int x = 0; x < 9; ++x)
					{
						if (puzzle[y][x] == i)
							check[y][x] = '*';
					}
				}
			}
		}

		for (int y = 0; y < 9; y += 3)
		{
			for (int x = 0; x < 9; x += 3)
			{
				for (int i = 1; i <= 9; ++i)
					state[i - 1] = none;

				for (int i = 0; i < 9; ++i)
				{
					int tx = x + i % 3, ty = y + i / 3;
					int t = puzzle[ty][tx];
					if (state[t - 1] == none)
						state[t - 1] = done;
					else
						state[t - 1] = dupli;
				}

				for (int i = 1; i <= 9; ++i)
				{
					if (state[i - 1] == dupli)
					{
						for (int j = 0; j < 9; ++j)
						{
							int tx = x + j % 3, ty = y + j / 3;
							if (puzzle[ty][tx] == i)
								check[ty][tx] = '*';
						}
					}
				}
			}
		}

		if (u != 0)
			putchar('\n');

		for (int y = 0; y < 9; ++y)
		{
			for (int x = 0; x < 9; ++x)
				printf("%c%d", check[y][x], puzzle[y][x]);

			putchar('\n');
		}
	}

	return 0;
}

