#define MAX 9

void print_table( int table[MAX][MAX], int table1[MAX][MAX] )
{
	for ( int i = 0 ; i < MAX ; i++ ) {
		for ( int j = 0 ; j < MAX ; j++ ) {
			printf( "%c%d", table1[i][j], table[i][j] );
		}
		printf( "\n" );
	}
}

int main()
{
	int n, tmp, dbl = 0;
	int table[MAX][MAX];
	int table1[MAX][MAX];

	scanf( "%d", &n );
	for ( int i = 0 ; i < n ; i++ ) {
		for ( int j = 0 ; j < MAX ; j++ ) {
			for ( int k = 0 ; k < MAX ; k++ ) {
				scanf( "%d", &table[j][k] );
			}
		}
		memset( table1, ' ', sizeof( table1 ) );

		for ( int j = 0 ; j < MAX ; j++ ) {
			for ( int k = 0 ; k < MAX ; k++ ) {
				tmp = table[j][k];

				/* 3x3で区切らない範囲で重複する数字がある場合 */
				// y軸方向に重複する数値の探索
				for ( int l = k+1 ; l < MAX ; l++ ) {
					if ( table[j][k] == table[j][l] ) {
						table1[j][k] = table1[j][l] = '*';
					}
				}

				// x軸方向に重複する数値の探索
				for ( int l = j+1 ; l < MAX  ; l++ ) {
					if ( table[j][k] == table[l][k] ) {
						table1[j][k] = table1[l][k] = '*';
					}
				}


				// 3x3の範囲で重複する文字列の探索
				for ( int l = j/3*3 ; l < j/3*3+3 ; l++ ) {
					for ( int m = k/3*3 ; m < k/3*3+3 ; m++ ) {
						if ( l == j && m == k ) { continue; }
						else if ( tmp == table[l][m] ) {
							table1[l][m] = '*';
						}
					}
				}
			}
		}
		print_table( table, table1 );
		if ( i != n-1 ) {
			printf( "\n" );
		}
	}

}

