void solve() {
	int i, j, k;
	for(i = 0; i < 9; ++ i) {
		for(j = 0; j < 9; ++ j) {
			scanf("%d", &puzzle[i][j]);
			error[i][j] = ' ';
		}
	}
	for(i = 0; i < 9; ++ i) {
		for(j = 0; j < 9; ++ j) {
			for(k = 0; k < 9; k ++) {
				if(k != i && puzzle[k][j] == puzzle[i][j]) {
					error[k][j] = '*';
					error[i][j] = '*';
				}
				if(k != j && puzzle[i][k] == puzzle[i][j]) {
					error[i][k] = '*';
					error[i][j] = '*';
				}
				if(k != i % 3 * 3 + j % 3 && puzzle[i / 3 * 3 + k / 3][j / 3 * 3 + k % 3] == puzzle[i][j]) {
					error[i / 3 * 3 + k / 3][j / 3 * 3 + k % 3] = '*';
					error[i][j] = '*';
				}
			}
		}
	}
}
