	int i, j, cnt[10], k;
	for (j = 0; j < 9; j++) {
		memset(cnt, 0, sizeof(cnt));
		for (i = 0; i < 9; i++)	cnt[a[0][i][j]]++;
		for (k = 1; k <= 9; k++)
			if (cnt[k] > 1)
				for (i = 0; i < 9; i++) 
					if (k == a[0][i][j]) a[1][i][j] = 1;
	}
