void parallel(int a[2][9][9]){
	int i, j, cnt[10], k;
	for (i = 0; i < 9; i++) {
		memset(cnt, 0, sizeof(cnt));
		for (j = 0; j < 9; j++)	cnt[a[0][i][j]]++;
		for (k = 1; k <= 9; k++)
			if (cnt[k] > 1)
				for (j = 0; j < 9; j++)
					if (k == a[0][i][j]) a[1][i][j] = 1;
	}
}

void square(int a[2][9][9], int h, int w){
	int i, j, cnt[10] = {}, k;
	for (i = h; i < h + 3; i++)
		for (j = w; j < w + 3; j++)
			cnt[a[0][i][j]]++;
	for (k = 1; k <= 9; k++) {
		if (cnt[k] > 1) {
			for (i = h; i < h + 3; i++)
				for (j = w; j < w + 3; j++)
					if (a[0][i][j] == k) a[1][i][j] = 1;
		}
	}
}

