                for (int iy = 0; iy < 9; iy++) {
                    if (!tateCheck(ix, iy)) { ok[iy, ix] = false; continue; }
                    if (!yokoCheck(ix, iy)) { ok[iy, ix] = false; continue; }
                    if (!sikakuCheck(ix, iy)) { ok[iy, ix] = false; continue; }
                }
            }
        }


        static bool tateCheck(int x, int y) {
            int n = puzzle[y, x];
            for (int i = 0; i < 9; i++) {
                if(i==y){continue;}
                if (n == puzzle[i, x]) { return false; }
            }
            return true;            
        }
        static bool yokoCheck(int x, int y) {
            int n = puzzle[y, x];
            for (int i = 0; i < 9; i++) {
                if (i == x) { continue; }
                if (n == puzzle[y, i]) { return false; }
            }
            return true;
        }
        static bool sikakuCheck(int x, int y) {
            int n = puzzle[y, x];
            int baseX = x - x% 3;
            int baseY = y - y % 3;
            for (int ix = baseX; ix < baseX + 3; ix++) {
                for (int iy = baseY; iy < baseY + 3; iy++) {
                    if (ix == x && iy == y) { continue; }
                    if (puzzle[iy, ix] == n) { return false; }
                }
            }
            return true;

        }




